import React from 'react'
import { FaHospital } from 'react-icons/fa';
import './stylesheet/Dashboard.css';
import './stylesheet/header2.css';

const Dashboard = ( { title, icon, number } ) =>
{
    return (
        <>
            <p className='header2'>
                <FaHospital size={ 46 } />
                <h1>Dashboard</h1>
            </p>
            <div>
      <Box title="Hospitals" icon={<FaHospital />} number={25} />
      <Box title="Users" icon={<FaUsers />} number={1000} />
      <Box title="Revenue" icon={<FaMoneyBillAlt />} number={50000} />
      <Box title="Awards" icon={<FaTrophy />} number={10} />
    </div>
        </>
    )
}

export default Dashboard
